import React from 'react';
import { useSelector } from 'react-redux';

const TableRow = ({board}) => {

    return (
        <tr>
            <td>{board.num}</td>
            <td>{board.subject}</td>
            <td>{board.readcount}</td>
            <td>{board['membersDTO']}</td>
        </tr>
    );
};

export default TableRow;
